	(272,'58835952','8917154','nataliakucma','Polecam','5/5','Towar zgodny z opisem. Klocki dobrze wykonane. Zestaw w całości. Nic nie brakowało. Pudełko idealne nic nie uszkodzone.',5,0,'2019-01-13 14:16:52','2019-01-13 14:16:52','[\'cena\', \'dobra jakość\', \'dużo elementów\', \'kreatywność\', \'trwałość\', \'wygląd\', \'zabawa\']','[]'),
	(273,'58835952','10369866','Kamila','Polecam','5/5','To już drugi raz jak kupiłam ten zestaw, tym razem na prezent dla kolegi syna. Jest świetny.\r\nFajny mały zestaw, ale sporo układania z uwagi na dużo małych klocków. Dużo radości za bardzo przyzwoitą cenę. Dodatkowy atut to ruchome elementy (dźwignie, zapadnie).\r\n5,5 latek ułożył go sam, więc ten wiek od 7 lat to trochę na wyrost.',1,1,'2019-04-09 11:10:43','2019-04-09 11:10:43','[]','[]'),
	(274,'58835952','8688475','Kamila','Polecam','5/5','Fajny mały zestaw, ale sporo układania z uwagi na dużo małych klocków. Dużo radości za bardzo przyzwoitą cenę. Dodatkowy atut to ruchome elementy (dźwignie, zapadnie).\r\n5,5 latek ułożył go sam, więc ten wiek od 7 lat to trochę na wyrost.',2,1,'2018-12-06 20:33:22','2018-12-06 20:33:22','[\'trwałość\', \'wygląd\', \'zabawa\']','[]'),
	(275,'58835952','8933465','Łukasz','Polecam','5/5','Dostałem te zestawy w przecenie za 75 zł, jeden jest dla mnie na półkę, dwa dla dzieci w rodzinie. Za taką cenę zawsze polecilbym ten zestaw, również dorosłym którzy nie czują się za starzy na eksponowanie gry ze swojego dzieciństwa. :P',0,1,'2019-01-16 10:01:00','2019-01-16 10:01:00','[\'cena\', \'dobra jakość\', \'dużo części zapasowych\', \'jedna z dwóch instrukcji w pudełku była\', \'kreatywność\', \'ładnie się prezentuje na półce\', \'trwałość\', \'wygląd\', \'zabawa\']','[\'bez przeceny trochę za drogo\']'),
	(276,'58835952','8943199','Edyta','Polecam','5/5','Bardzo fajny zestaw klocków. Chrześniak zachwycony, a jego siostra zazdrosna. Jak to Lego, wszystko pasuje i daje dużo więcej możliwości niż tylko to co obiecuje pudełko.',0,0,'2019-01-17 12:24:18','2019-01-17 12:24:18','[\'dobra jakość\', \'trwałość\', \'wygląd\', \'zabawa\']','[]'),
	(277,'58835952','8826714','Artur','Polecam','4/5','Trwaly, solidnie wykonany choć moim zdaniem cena nie jest adekwatna do produktu. Najwązniejsze jednak, ze syn bardzo się ucieszył z tego zestawu.',1,0,'2018-12-28 23:10:21','2018-12-28 23:10:21','[]','[]'),
	(278,'58835952','8746751','Agu1985','Polecam','5/5','Klocki Lego nigdy się nie nudzą. Teraz modny jest Minecraft wówczas liczę że obdarowaćny będzie zadowolony.',0,0,'2018-12-28 07:06:15','2018-12-28 07:06:15','[\'wygląd\']','[]'),
