	(406,'125321580','15759816','Dawid','Polecam','5/5','Pierwsze wrażenia (po ok. 1 tygodniu użytkowania) - równie dobre, jak pierwszego dnia :) Telefon działa szybko, płynnie - choć byłem zadowolony z Galaxy Note 10+, różnica w szybkości jest odczuwalna. Na pokładzie Android 12 (One UI 4.1) - i już doczekałem się aktualizacji (m.in, zabezpieczeń - marzec 2022). Jakość wykonania, szybkość, sprawność działania, intuicyjność - plusów jest wiele (także współpraca z akcesoriami Samsunga, jak  np. smartwatch Galaxy Watch 4 Classic). Wodoodporność - mam nadzieję, że jest, pewnie niedługo przetestuję :) Fotografia - bardzo OK, musze jeszcze potestować zdjęcia nocne. Co mogłoby pójść lepiej? Max pamięć - 12 GB RAM - oby starczyło, w Note 10+ starczało, mam nadzieję, że Samsung będzie dobrze optymalizował system i sprzęt za jakiś czas nie będzie tęsknił za 16 GB. Także 512 GB - max bez możliwości dołożenia kart SD - na razie starcza, ale... Dobrej jakości zdjęcia i filmy zajmują sporo miejsca ;) Cena... no cóż, nie komentuję. Póki co - polecam! :)',4,2,'2022-02-28 11:23:36','2022-02-28 11:23:36','[\'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[\'czas pracy na baterii\']'),
