	(425,'125321580','15759976','Użytkownik Ceneo','Nie polecam','2/5','Telefon ładny, całkiem sprawnie działa ale jak nie używa się go zbyt intensywnie. Gdy udostępnia się internet, używa jednocześnie kilku aplikacji (np. wideorozmowy, pobieranie plików, surfowanie po internecie) lub podłączy się ładowarkę to telefon momentalnie się nagrzewa i to bardzo, wydajność tragicznie spada, wyłączają się aplikacje by zapobiec dalszemu grzaniu się telefonu (niestety to nie pomaga). W wyżej opisanych sytuacjach ten telefon traci sens, wydajny ten telefon jest tylko na papierze bo praktycznie to ten telefon to tragedia... Takie działanie telefonu zrozumiałbym w sprzęcie za 1000-1500 zł ale nie za 6000 zł. Jeżeli tego nie da się naprawić aktualizacjami to nie polecam zakupu a cały model można spisać na straty. Czas pracy na baterii też nie zachwyca. Po powrocie do domu po 8 godzinach pracy koniczne jest podłączenie telefonu do ładowarki - o ile nie musiałem tego zrobić w trakcie pracy. Dodatkowo, od wyjęcia z pudełka ekran miał problemy z dotykiem. Np. musiałem kliknąć coś kilka razy zanim załapało. Szybko wyszła aktualizacja która poprawiła trochę ten stan ale dalej nie jest idealnie. Oprócz tego oprogramowanie działa fajnie, aparaty robią mega zdjęcia.',2,11,'2022-02-28 11:56:07','2022-02-28 11:56:07','[\'łatwość obsługi\', \'wygląd\']','[\'cena do jakości\', \'czas pracy na baterii\', \'funkcjonalność\', \'nagrzewanie się\', \'praca pod obciążenie\']'),
