	(442,'115151302','15385266','o...1','Polecam','5/5','Telefon bardzo dobry ale Apple z cenami zaczyna przesadzać - ekosystem Apple mnie do nich przywiązał ale nie wiem na jak długo jeśli produkty będą w kwocie dwóch średnich krajowych. Po przesiadce z IPhone XS to szybkość działania, ekran i aparat na duzy plus. Duży minus to waga produktu (w stosunku do XS bardzo ciężki) oraz kształt (xs to telefon zdecydowanie poręczniejszy). iPhone 13 Pro to kloc w użytkowaniu i teraz pewnie wybrałbym lżejszego iPhone 13, bo nawet pisząc ta opinie czuje nadprogramowe gramy tego telefonu.',7,4,'2021-12-17 12:06:18','2021-12-17 12:06:18','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\']','[\'cena\', \'łatwość obsługi\', \'wygląd\']'),
