	(448,'115151302','15698451','m...3','Polecam','5/5','Powiem tak.. Jako roczny użytkownik Samsunga Galaxy S21 Ultra 5G po przesiadce na iphone 5 pro jestem bardzo zadowolony. Bryła telefonu przypomina mocno to co było znane w iphone 5s, świetnie leży w dłoni. Telefon sam w sobie zgrabny, bardzo poręczny. Do kieszeni się mieści, nie uwiera. Samo urzadzenie działa jak rakieta ale nie ma co sie dziwic, system operacyjny robi swoje. Fotki świetne. Jedyne do czego sie mozna przyczepic to brak czytnika lini papilarnych. Leżąc w łóżku w nocy trzeba telefon podnosic do papy zeby sie otworzyl lub wklepywac 5 cyfrowy pin. Generalnie 10/10 ale cena to dramix',3,5,'2022-02-14 11:27:05','2022-02-14 11:27:05','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
