	(451,'115151302','15940539','a...z','Polecam','5/5','Posiadam od paru dni, jestem bardzo zadowolona. Jest szybki, bateria wydajna, dużo nowych funkcji, jak zwykle intuicyjny, na pewno muszę poświęcić sporo czasu, żeby poznać wszystkie jego możliwości. Błyskawiczne przekładanie danych z poprzedniego telefonu. Przyjemnie się z niego korzysta, również ze względu na wygląd. Polecam, choć oczywiście mógłby być tańszy. Ale zawsze, inwestując w najnowszy model, mam pewność, że posłuży mi kilka lat, lubię korzystać z rzeczy długo, aż się naprawdę wysłużą, a potem przydadzą jeszcze komuś. To ulga dla planety, wygoda dla użytkownika. I te możliwości dają mi właśnie produkty Apple.',0,4,'2022-04-09 11:06:34','2022-04-09 11:06:34','[\'aparat\', \'bateria długo działa\', \'czas pracy na baterii\', \'fajne zdjęcia filmy\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'mała głębia ostrości\', \'wygląd\']','[\'cena\', \'wysoka cena\']'),
