	(469,'115151302','15718796','k...h','Polecam','4,5/5','Telefon jest przepiękny. Kolor bardzo zbliżony do tego ze zdjęcia, chociaż na unboxingach wygląda prawie jak biały. Aparat to totalny sztos. Jedyne zastrzeżenia mam co do szybkości dotyku, czasami nie łapie tak jak powinien, ale to może być równie dobrze za sprawą szkła. Bateria w telefonie, który nie jest użytkowany dłużej niż 15 minut dziennie wytrzymala spokojnie tydzień na 50% naladowaniu widocznym po uruchomieniu (tyle czasu mi zajęło zgranie plików i przełożenie karty).',1,0,'2022-02-17 20:21:10','2022-02-17 20:21:10','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
