	(474,'115151302','16006649','a...m','Polecam','5/5','13ka to następca wysłużonego modelu 6s i czuć ten postęp technologiczny. Telefon działa bardzo płynnie, sprawnie i sprawia wrażenie, że znów posłuży przez dłuższy czas. Wykonanie absolutnie na plus - czuć, że obcuje się z porządnym sprzętem. Zdecydowanie na korzyść przemawia też fakt, że iphone z wyświetlaczem 6,1\" pozostaje dość poręczny. Co do IOS - wszystko intuicyjne. to po prostu kontynuacja przygody z tym systemem operacyjnym. Ogólne wrażenie bardzo pozytywne.',0,0,'2022-04-25 21:47:14','2022-04-25 21:47:14','[\'aparat\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(475,'115151302','15909839','m...5','Polecam','4,5/5','Jakość wykonania na najwyższym poziomie. Natomiast telefon, no cóż decydując się na zakup konkretnego modelu, niezależnie jakiej marki, zawsze bierzemy telefon z jego mocnymi i słabymi stronami. Dlatego należ dobrze zapoznać się z tym, na co się decydujemy. Dla mnie najistotniejszy przy zakupie był jego niewielki rozmiar. Rozmiar rekompensuje mi np. brak możliwości ustawienia głośności budzika. Choć możliwe, że jeszcze nie znalazłem takiego ustawienia :)',0,0,'2022-04-02 22:02:53','2022-04-02 22:02:53','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
