	(477,'115151302','15791346','t...k','Polecam','5/5','Poszukiwałem niewielkiego smartfona. Poprzednio użytkowałem jedynie flagowych smartfonow z androidem, które zaczęto robić coraz większe.\nRozmiar iphona 13 mini jest jednak jego nie tylko zaletą ale i wadą.\nEkran 5.4 cala i 60Hz sprawia, że przeglądanie treści jest dużo mniej przyjemne niż na Samsungu s21 6.2 cala 120Hz.\nWróciłem do S21.\nŻe względu na długie wsparcie iphonów, dam im jeszcze szanse ale w większym rozmiarze i 120Hz',1,0,'2022-03-07 23:43:39','2022-03-07 23:43:39','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[]'),
