	(506,'115151302','16149151','m...8','Polecam','5/5','SPRZĘT NA WYSOKIM POZIOMIE. CENA WYSOKA, ALE NIE ŻAL TYCH PIENIĘDZY. ŁADNY, NIEZAWODNY, NIE ZAWIESZA SIĘ. JEŻELI KOGOŚ STAĆ, TO POLECAM. SPRZĘT NA LATA. DAJE SATYSFAKCJĘ Z UŻYTKOWANIA. APARAT, TO REWELACJA. PO WYŁĄCZENIU NIEPOTRZEBNYCH RZECZY, TO NAWET BATERIA TRZYMA 2-3 DNI PRZY DOŚĆ INTENSYWNYM UŻYTKOWANIU. TELEFON JEST SUPER, ALE CENA POWINNA BYĆ NIECO NIŻSZA. ALE MIMO TO POLECAM.',0,0,'2022-05-30 22:48:47','2022-05-30 22:48:47','[\'120hz odświeżanie\', \'aparat\', \'bateria długo działa\', \'czas pracy na baterii\', \'fajne zdjęcia filmy\', \'funkcjonalność\', \'idealny do macbook-a\', \'kręcenie filmów\', \'lidar\', \'łatwość obsługi\', \'mała głębia ostrości\', \'wygląd\']','[\'cena\', \'wysoka cena\']'),
	(507,'115151302','15039916','j...r','Polecam','5/5','Po użytkowaniu dużych - ten mały jest super. Nareszcie wygoda w obsłudze (choć z dużymi tez nie miałem problemu) ale w noszeniu w kieszeni bajka. Większe sprawy załatwiam na iPadzie więc dla kogoś kto nie gara na iPhonie, a służby mu jedynie do komunikowania się i do podstawowych rzeczy - ban, płatności, nawigacja itp Ten jest idealny.',5,2,'2021-10-06 11:38:49','2021-10-06 11:38:49','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(508,'115151302','15204858','kuch grz','Polecam','5/5','Świetna jakość wykonania. Od dawna nie używałem iPhonów, ale na ten egzemplarz się skusiłem po wielu latach. I nie żałuję. Nie wiedziałem, że przesiadka z Huawei czy Xiaomi będzie tak ogromna. 13 Pro max to klasa sama w sobie. Apart świetny (choć ma słaby zoom). Bateria trzyma kilka dni, ładuję co 3-4 przy zwykłym użytkowaniu.',1,3,'2021-11-14 20:29:15','2021-11-14 20:29:15','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(509,'115151302','15715037','p...n','Polecam','5/5','Używam telefonów marki Apple od ponad 8 lat i niestety nie spodobało mi się to, że telefony są coraz większe. Mam małe dłonie i biorąc iPhone’a 13 byłby dla mnie o wiele za duży. Za to 13 mini jest idealna, można nawet obsługiwać jedna ręka bez problemu. Co do działania to nie mam co narzekać, bo mimo swojej ceny są to solidne telefony.',0,0,'2022-02-17 10:38:27','2022-02-17 10:38:27','[]','[]'),
	(510,'115151302','15931377','d...0','Polecam','5/5','Miałem częściej IPhone 11 który bardzo szybko skończył swój żywot z racji swoich gabarytów ponieważ pracuje jako elektryk. Natomiast 13 co do systemu nie mam jak zawsze żadnych zaostrzeń rozmiar przy mojej pracy jest idealny świetnie leży w ręku. Cena tez odpowiednia. Martwi mnie fakt i w 14 nie będzie wersji mini',0,0,'2022-04-07 15:59:04','2022-04-07 15:59:04','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(511,'115151302','16091149','d...7','Nie polecam','1/5','Za drogie ***** ale jabłko musi być',1,0,'2022-05-16 21:36:15','2022-05-16 21:36:15','[\'wygląd\']','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\']'),
	(512,'115151302','15022910','s...r','Polecam','5/5','Pierwsze wrażenia to świetnie wykonany telefon. Fakt po 10 latach przechodzę z Android wiec mam świadomość ze iOS różni się w wielu miejscach od Androida ale póki co doświadczenia z samym systemem i urządzeniem aż nad pozytywne',3,0,'2021-10-01 18:31:55','2021-10-01 18:31:55','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(513,'115151302','15749026','d...2','Polecam','5/5','Najlepszy telefon jaki miałem, szczerze. Byłem od lat związany z androidem, z telefonami flagowymi i naprawdę iPhone 13 Pro zrobił na mnie największe wrażenie. Może się starzeję, ale nie potrzebuję już otwartego systemu, zamknięty iOS wystarcza mi w zupełności. Szczerze polecam!',2,0,'2022-02-24 18:59:19','2022-02-24 18:59:19','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(514,'115151302','15290374','s...4','Polecam','4/5','Telefon ma bardzo dobrą baterię, wytrzymuje dłużej niż Samsung S 21 Ultra, przystępny aparat ( choć mógłby lepiej łapać ostrość przy maksymalny przybliżeniu cyfrowym ), urządzenie posiada niesamowicie dobre głośniki ( głośny i klarowny dżwięk ). Jedyny minus to brak ładowarki w zestawie.',2,1,'2021-12-01 21:19:40','2021-12-01 21:19:40','[]','[]'),
	(515,'115151302','15809186','Iwona','Polecam','5/5','Telefon jest piękny, jestem bardzo zadowolona z zakupu. Kolor, design - super!  Aparat rewelacja! Bateria trzyma wystarczająco długo jak na to ile użytkuje w ciągu dnia telefon. iPhone 13 pro to telefon idealny, zarówno pod względem wyglądu, wielkości jak i funkcjonalności. Polecam!',1,0,'2022-03-11 09:55:38','2022-03-11 09:55:38','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(516,'115151302','15770266','m...a','Polecam','4,5/5','Jestem zadowolona jak na tą chwile, trudno mi coś więcej napisać bo mam go dopiero tydzień. Zmieniłam z 6s na ten model więc to duża „przesiadka”. Nie jestem do końca przekonana czy wielkość telefonu mi pasuje, ale to dopiero będę mogła ocenić po dłuższym użytkowaniu.',0,0,'2022-03-02 18:07:10','2022-03-02 18:07:10','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(517,'115151302','16243536','l...a','Polecam','5/5','Cóż dodać- kto używał iPhone ten wie że jest bardzo praktyczny. To mój kolejny i mimo ceny i głosu rozsądku wybieram produkt Apple. Trochę za szybko się przegrzewa przy ładowaniu i rozmawianiu z wizją i potrafi się wyłączyć. Dobrej jakości zdjęcia, fajne funkcje.',0,0,'2022-06-23 12:08:32','2022-06-23 12:08:32','[\'aparat\', \'fajne zdjęcia filmy\', \'funkcjonalność\', \'idealny do macbook-a\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[\'bateria długo działa\', \'czas pracy na baterii\']'),
	(518,'115151302','15912101','t...s','Polecam','5/5','To już kolejny produkt, który kupuje w Firmie Lantre I na pewno nie ostatni. Profesjonalna obsługa miłe doradztwo, towar zawsze solidnie zabezpieczony do wysyłki.Błyskawiczna wysyłka.Z pełną odpowiedzialnością polecam ten sklep !!!',0,0,'2022-04-04 09:18:40','2022-04-04 09:18:40','[]','[]'),
	(519,'115151302','15776252','m...b','Polecam','5/5','Według mnie produkt firmy Apple to dobry wybór. Długo sie nad tym zastanawiałem ale to dobry wybór. Kwestia przyzwyczajenia jeśli chodzi o system, lecz na plus. Naprawdę moge polecić. Aparat jest świetny. Telefon śmiga bez zarzutu.',0,0,'2022-03-03 19:38:52','2022-03-03 19:38:52','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(520,'115151302','15821989','b...o','Polecam','5/5','Przesiadłem się z Samsunga na Iphona i to była bardzo dobra decyzja. Telefon robi super zdjęcia. Jest łatwy w obsłudze. Bardzo szybko reaguje. W sumie to narazie nie ma do czego się przyczepić :) Bateria trochę kiepsko trzyma.',0,0,'2022-03-15 07:11:33','2022-03-15 07:11:33','[\'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[\'czas pracy na baterii\']'),
	(521,'115151302','16011698','d...a','Polecam','5/5','Telefon bardzo dobrze się sprawuje, zdjęcia robi bardzo dobrej jakości- na tym mi najbardziej zależało. Bateria trzyma bardzo długo, nawet 2-3 dni przy częstym używaniu telefonu. Polecam zakup tego modelu ?',0,0,'2022-04-27 02:19:11','2022-04-27 02:19:11','[\'czas pracy na baterii\', \'wygląd\']','[]'),
	(522,'115151302','15111522','d...6','Polecam','5/5','Mam dopiero jeden dzień, ale już jestem bardzo zadowolona. Szybko działa, bardzo dobra bateria, piękne zdjęcia! Zobaczymy jak będzie z czasem, ale na ten moment polecam! No i ten kolor!',1,0,'2021-10-21 22:59:27','2021-10-21 22:59:27','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(523,'115151302','16220025','j...k','Polecam','4,5/5','Telefon super, jak zawsze niezawodny sprzęt. Zmieniłam na ten model z iPhone X i zmiana nie jest jakaś spektakularna :) Poza lepszym aparatem nie ma co liczyć na jakąś wielką innowację.',0,0,'2022-06-17 10:40:49','2022-06-17 10:40:49','[]','[]'),
	(524,'115151302','15716166','t...i','Polecam','5/5','Telefon jest wizualnie piękny. Działa rewelacyjnie ! Dość drogi (szczególnie z opcją ubezpieczenia ) ale uważam, że watro. Przekonał mnie do zbudowania cełego zestawu Apple',1,0,'2022-02-17 12:33:41','2022-02-17 12:33:41','[]','[]'),
	(525,'115151302','15673065','d...o','Polecam','5/5','Nigdy nie byłem przekonany do tej marki. Od zawsze zakochany w Samsungu. Jednak już chyba nie wrócę. Kwestia przyzwyczajenia. Mega bateria. A używam naprawdę dużo telefonu.',1,0,'2022-02-08 17:33:47','2022-02-08 17:33:47','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[\'cena\']'),
	(526,'115151302','15710444','m...n','Polecam','5/5','Klasa sama w sobie, piękny kolor (delikatny róż, zdjęcie producenta zdecydowanie nie oddaje go w rzeczywistości). Zmieniłam moją 8 na 13 i różnica jest piorunująca :)',1,0,'2022-02-16 16:40:40','2022-02-16 16:40:40','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(527,'115151302','15310557','w...x','Polecam','5/5','Produkt bardzo dobry ale nie powinien kosztować więcej im 2400zl. Ponieważ i tak za 2 -3 lata musimy zmienić na nowy. Te ceny na nowe iPhone bardzo przewartościowane',3,2,'2021-12-05 22:48:49','2021-12-05 22:48:49','[]','[]'),
	(528,'115151302','15789913','k...0','None','3,5/5','Po przesiadce z iPhone 13 pro ciężko było się odnaleźć. Na plus rozmiar ale coś brakowało w zdjęciach , niby nie było dużej różnicy ale przybliżenia 3x brak, jednak oddałem',0,0,'2022-03-07 18:43:22','2022-03-07 18:43:22','[\'aparat\', \'cena\', \'czas pracy na baterii\', \'fajne zdjęcia filmy\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(529,'115151302','15501958','m...3','Polecam','5/5','Nie mogę wydać opinii ponieważ nie udało mi się dokończyć transakcji zakupu tego produktu.To wszystko zbyt skomplikowane jeżeli nie posiada się drukarki.Dziekuję.',1,0,'2022-01-04 15:59:57','2022-01-04 15:59:57','[]','[]'),
	(530,'115151302','15895308','m...y','Polecam','4,5/5','Super jakość, płynność i design. Praca na baterii jest ok ale gdyby była troszeczkę większa to byłoby ideal. Trzyma 1 dzień intensywnego i max 2 dni sporadycznego używania.',0,0,'2022-03-31 00:01:58','2022-03-31 00:01:58','[\'aparat\', \'fajne zdjęcia filmy\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[\'bateria długo działa\', \'czas pracy na baterii\']'),
	(531,'115151302','15018005','m...0','Nie polecam','1/5','Niestety deklarują że iPhone 13 mini jest szybki ale niestety  nie jest szybki jest wolny i się strasznie nagrzewa interfejsjest toporny  chodzi reakcja  ekranu wolno .nie polecam szkoda gadać przereklamowany',10,58,'2021-09-30 17:48:24','2021-09-30 17:48:24','[\'wygląd\']','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\']'),
	(532,'115151302','15375376','s...j','Polecam','5/5','Wszystko na 5 , jedynie cena dość wysoka :-) bateria przy normalnym( yt, aparat , fb , gry typu clash royal)  użytkowaniu wytrzymuje 1 dzień bez najmniejszego problemu .',0,0,'2021-12-16 07:05:43','2021-12-16 07:05:43','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[\'cena\']'),
	(533,'115151302','15368018','p...z','Polecam','5/5','Miazga, bardzo szybki, świetny aparat j jakość filmów. A przede wszystkim, jest wygodny w użyciu przez stosunkowo niewielki rozmiar, nie wypucha kieszeni, nie przeszkadza',0,0,'2021-12-15 10:34:57','2021-12-15 10:34:57','[\'aparat\', \'czas pracy na baterii\', \'funkcjonalność\', \'kręcenie filmów\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(534,'115151302','15820240','j...k','Polecam','5/5','Zgrabny, dobrze leży w dłoni. To mój pierwszy iPhone i miałam wiele obaw czy sobie poradzę z jego obsługą jednak oprogramowanie okazało się bardzo intuicyjne.',1,0,'2022-03-14 19:37:47','2022-03-14 19:37:47','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
	(535,'115151302','15756655','Roman','Polecam','5/5','Kapitalna konfiguracja, w pełni zgodna z oczekiwaniami. W ofercie sklepu Lantre, w połączeniu z natychmiastową dostępnością - oferta godna \n zaakceptowania.',1,0,'2022-02-26 17:18:08','2022-02-26 17:18:08','[\'czas pracy na baterii\', \'funkcjonalność\', \'łatwość obsługi\', \'wygląd\']','[]'),
