	(973,'92073879;02514','13333625','k...m','Polecam','4,5/5','Po kilku dniach użytkowania jestem zadowolona. Odkurzam podłogę drewnianą na najnizszej mocy. Wszystko wciąga,filtr łatwo się czyści. Trochę jest ciężki ale to pewnie kwestia przyzwyczajenia bo do tej pory używałam tradycyjny odkurzacz. Brakuje mi szczotki z długim miękkim włosiem.',1,2,'2020-11-06 09:01:12','2020-11-06 09:01:12','[]','[]'),
	(974,'92073879;02514','13194537','Użytkownik Ceneo','Polecam','5/5','Bardzo dobry produkt, zresztą Miele to dla mnie mercedes na rynku. Cieszę się od dwóch dni jak dziecko z nowej zabawki, bardzo dobrze odkurza, \n a przede wszystkim łatwo się prowadzi i dzięki temu że \"mózg\" tego odkurzacza jest na dole faktycznie nie obciąża to nadgarstka, poza tym można go zaparkować gdziekolwiek bez potrzeby opierania o ścianę, rozpoznaje podłogę i dywan, no a największym plusem jest oświetlenie led, o którym myślałam że to taki bajer , jakieś lapmki po prostu, otóż nie, to oświetlenie pokazuje Ci jak faktycznie masz brudną podłogę, niesamowicie dobrze widać kurz, bez tych lamp tego nie widać i to było dla mnie mega zaskoczeniem, polecam polecam i jeszcze raz polecam!',5,1,'2020-10-12 10:35:53','2020-10-12 10:35:53','[]','[]'),
	(975,'92073879;02514','15657645','m...6','Polecam','5/5','Na razie testuje 2 dni - jestem bardzo zadowolona - z tym podświetleniem widać każdy pyłek ? Polecam',0,0,'2022-02-04 12:17:47','2022-02-04 12:17:47','[]','[]'),
	(976,'92073879;02514','16144057','okskor','Polecam','5/5','Odkurzacz działa bardzo dobrze, cicho, intuicyjne urzytkowanie, przezentuje się bardzo ładnie.',0,0,'2022-05-29 12:36:21','2022-05-29 12:36:21','[]','[]'),
